import Chatkit from "@pusher/chatkit-client";
import MessageList from './components/MessageList'
import { instanceLocator, chatkit_token_provider } from './config';
// import SendMessageForm from './components/SendMessageForm'
// import RoomList from './components/RoomList'
// import NewRoomForm from './components/NewRoomForm'


class App extends React.Component {
  componentDidMount() {
    const chatKitManager = new chatKitManager({
      instanceLocator,
      userId: "meeks",
      chatkit_token_provider: new chatKitManager({
        url: chatkit_token_provider
      })

    })

    chatKitManager.connect()
      .then(currentUser => {
        currentUser.AddToRoom({
          // roomId: 754e4b8640ec482ab38595833eb7f6e2,
          hook: {
            onNewMessage: message => {
              console.log('message.text', message.text);
            }
          }
        })


      })




  }
  render() {
    return (
      <div className="app">
        <MessageList />
      </div>
    )
  }
}

export default App;
